import Link from 'next/link';
import Layout from '../components/Layout';
import Head from 'next/head';

const Index = () => (
    <Layout mainTitle="My Home Page  built with next JS and React JS" footer={`Copyright ${new Date().getFullYear()}`} >
        <Head>
            <title>Home Page</title>
            <meta name="description" content="My SEO react app with next js" />
            <meta name="keyword" content="next react seo" />
            <meta name="author" content="Max Garcia" />
            <link
                rel="stylesheet"
                href="https://unpkg.com/bootstrap-material-design@4.1.1/dist/css/bootstrap-material-design.min.css"
                integrity="sha384-wXznGJNEXNG1NFsbm0ugrLFMQPWswR3lds2VeinahP8N0zJw9VWSopbjv2x7WCvX"
                crossorigin="anonymous" />
        </Head>
        <h2>Hello from Next JS</h2>
        <Link href="/About">
            <a >Go to about</a>
        </Link>

        <p>Lorem ipsum dolor sit amem</p>

        <style jsx>{`
            p {
                color : green;
                font-size: 22px;
            }
        `}</style>
    </Layout>
);

export default Index;
